window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"27.2.0","implementation":{"name":"cucumber-jvm","version":"7.21.1"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"23.0.1+11"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1740524386,"nanos":156624000}}},{"source":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/01Login.feature","data":"@login\r\nFeature: Login Page Verification\r\n\r\n  Background: \r\n    Given The browser is open\r\n    When Admin gives the correct LMS portal URL\r\n\r\n  Scenario: Verify Admin is able to land on login page\r\n    Then Admin should land on the login page\r\n\r\n  Scenario: Verify application name\r\n    Then Admin should see application name\r\n\r\n  Scenario: Verify for broken link\r\n    Then Admin should verify the broken links\r\n\r\n  Scenario: Verify company name\r\n    Then Admin should see company name below the app name\r\n\r\n  Scenario: Validate sign in content\r\n    Then Admin should see Please login to LMS application text displayed\r\n\r\n  Scenario: Verify text field is present\r\n    Then Admin should see 2 text field\r\n\r\n  Scenario: Verify text on the first field\r\n    Then Admin should see \"User\" in the first text field\r\n\r\n  Scenario: Verify text on the second field\r\n    Then Admin should see \"Password\" in the second text field\r\n\r\n  Scenario: Verify asterisk mark symbol next to user text\r\n    Then Admin should see asterisk mark symbol next to User \"User\" text\r\n\r\n  Scenario: Verify asterisk mark symbol next to password text\r\n    Then Admin should see asterisk mark symbol next to password \"Password\" text\r\n\r\n  Scenario: Verify dropdown is present\r\n    Then Admin should see one dropdown\r\n\r\n  Scenario: Verify placeholder in dropdown to select role\r\n    Then Admin should see Select The Role placeholder in dropdown\r\n\r\n  Scenario: Verify dropdown option to select role\r\n    Then Admin should see Admin Staff and Student options in dropdown\r\n\r\n  Scenario: verify Login button is present\r\n    Then Admin should see login button\r\n\r\n  Scenario: Verify the text spelling in the page\r\n    Then Admin should see correct spellings in all fields\r\n\r\n  Scenario: Verify input descriptive test in user field\r\n    Then Admin should see user in gray color\r\n\r\n  Scenario: Verify input descriptive test in password field\r\n    Then Admin should see password in gray color\r\n\r\n  Scenario: Verify the alignment input field for the login\r\n    Then Admin should see input field on the centre of the page\r\n\r\n  Scenario: Verify input descriptive text in user field\r\n    Then Admin should see user in gray color\r\n\r\n  Scenario: Verify input descriptive text in password field\r\n    Then Admin should see password in gray color\r\n\r\n  #Scenario: Login to the application with Valid details\r\n     #Given Admin logs into the application \r\n\r\n  Scenario Outline: Validate login with different data in all field\r\n    When Admin enter required data from login \"<sheet>\" for required \"<scenario>\" and clicks login button\r\n    Then Admin should get proper response on webpage based on \"<scenario>\"\r\n\r\n    Examples: \r\n      | sheet     | scenario    |\r\n      | loginData | validLogin  |\r\n      | loginData | invalidUser |\r\n      | loginData | invalidPwd  |\r\n      | loginData | invalidRole |\r\n      | loginData | withoutUser |\r\n      | loginData | withoutPwd  |\r\n      | loginData | withoutRole |\r\n\r\n  \r\n  Scenario Outline: verify login button action through mouse\r\n    When Admin enter required data from login \"<sheet>\" for required \"<scenario>\" and clicks login button\r\n    Then Admin should land on dashboard page\r\n\r\n    Examples: \r\n      | sheet     | scenario   |\r\n      | loginData | validLogin |\r\n\r\n  Scenario Outline: verify login button action through keyboard\r\n    When Admin enter required data from login \"<sheet>\" for required \"<scenario>\" and clicks login button through keyboard\r\n    Then Admin should land on dashboard page\r\n\r\n    Examples: \r\n      | sheet     | scenario   |\r\n      | loginData | validLogin |\r\n\r\n  Scenario: Verify Admin is able to land on home page with invalid URL\r\n    When Admin gives the invalid LMS portal URL\r\n    Then Admin should receive application error\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/01Login.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@login","id":"cc4f4fbe-28c5-4422-8cc7-3f8fa12bc91e"}],"language":"en","keyword":"Feature","name":"Login Page Verification","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"The browser is open","id":"1a06b78c-e525-46c4-b2c9-aa799a6c3321"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin gives the correct LMS portal URL","id":"c9fbb99b-60f4-4018-8701-2f6cd174d592"}],"id":"56769b90-7046-49b0-9bab-44d98c905e15"}},{"scenario":{"location":{"line":8,"column":3},"tags":[],"keyword":"Scenario","name":"Verify Admin is able to land on login page","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should land on the login page","id":"47c2a5a2-782d-4668-8a28-af71bc2cd07e"}],"examples":[],"id":"2780ac09-a43d-405d-9cfc-617b1016fffa"}},{"scenario":{"location":{"line":11,"column":3},"tags":[],"keyword":"Scenario","name":"Verify application name","description":"","steps":[{"location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"A a\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/02Dashboard.feature","name":"Verify staff count","language":"en","steps":[{"astNodeIds":["b302bf71-b85f-4868-8273-a941a2b2bcf8"],"id":"96b9f134-6aef-4e5d-988c-8e148b50e55a","type":"Context","text":"Admin logs into the application"},{"astNodeIds":["b1b0b1f0-e9da-4808-9e31-e30fd28f03f2"],"id":"b7753347-7043-4ece-ae6f-ad539b8c5630","type":"Outcome","text":"Admin should see staff count including Active and inactive"}],"tags":[],"astNodeIds":["65b41819-bd2d-4783-aaab-7e63f3fb81fe"]}},{"pickle":{"id":"b396b7e5-a3c2-4f9a-abdc-54d7d5cd1d85","uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/02Dashboard.feature","name":"Verify program count","language":"en","steps":[{"astNodeIds":["b302bf71-b85f-4868-8273-a941a2b2bcf8"],"id":"ad441fd1-d693-4f56-9b62-c48721b41e5e","type":"Context","text":"Admin logs into the application"},{"astNodeIds":["4aaa9bf6-fab7-4766-9f18-a98af6da6995"],"id":"fc42cb6c-852e-455e-8cb5-747cbd38f177","type":"Outcome","text":"Admin should see Program count including Active and inactive"}],"tags":[],"astNodeIds":["179d3e76-1fb1-4c57-8702-3f1f52258750"]}},{"pickle":{"id":"3231b570-9219-43c5-b680-2fe3f7ab3e3f","uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/02Dashboard.feature","name":"Verify batch count","language":"en","steps":[{"astNodeIds":["b302bf71-b85f-4868-8273-a941a2b2bcf8"],"id":"9fe3770a-ebb0-4ddb-8bb2-0b82ce65aadc","type":"Context","text":"Admin logs into the application"},{"astNodeIds":["088ffc1c-8baf-4a5f-89be-571eeca65345"],"id":"4b2078ce-3a25-4c37-baa4-ad533da7444d","type":"Outcome","text":"Admin should see batch count including Active and inactive"}],"tags":[],"astNodeIds":["4862f673-69ed-4072-a954-54cfb722973b"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/04Batch.feature","data":"Feature: Batch Page Navigation\r\n\r\n  Background: \r\n   # Given Admin successfully logged on to the LMS Portal for batch\r\n     Given Admin logs into the application\r\n  Scenario: Verify Admin Navigate to Batch page successfully\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should be in the Manage Batch Page\r\n\r\n  Scenario: Validate Title in Batch Page\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the LMS-Learning Management System Title for batch page\r\n\r\n  Scenario: Validate Heading in the Batch Page\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the Manage Batch Heading\r\n\r\n  Scenario: Validate disabled Delete Icon under the header in the Batch Page\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the disabled Delete Icon under the header in the Batch Page\r\n\r\n  Scenario: Validate pagination in the Batch Page\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the enabled pagination controls under the data table in the Batch Page\r\n\r\n  Scenario: Validate edit icon in each data row\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the edit icon in each row in the Batch Page\r\n\r\n  Scenario: Validate delete icon in each data row\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the delete icon in each row in the Batch Page\r\n\r\n  Scenario: Validate checkbox in each data row\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the checkbox in each row in the Batch Page\r\n    \r\n  Scenario: Validate Datatable headers\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the datatable headers Batch Name, Batch Description, Batch Status, No Of Classes, Program Name, Edit Delete in the Batch Page\r\n\r\n  Scenario: Validate Checkbox in the Datatable header row\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the checkbox in the datatable header row in the Batch Page\r\n\r\n  Scenario: Validate Sort Icon next to all the datatable headers\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on the Batch menu from the header\r\n    Then Admin should see the sort icon next to all Datatable headers in the Batch Page\r\n\r\n  Scenario: Verify sub-menu displayed in batch menu bar\r\n    Given Admin is on the batch page\r\n    When Admin clicks Batch on the navigation bar\r\n    Then Admin should see sub-menu in menu bar as Add New Batch\r\n\r\n  Scenario: Validate Admin able to click on the Add New Batch Option\r\n    Given For batch Admin is on the home page\r\n    When Admin clicks on Add New Batch under the Batch menu bar\r\n    Then Admin should see the Batch Details pop-up window\r\n\r\n  Scenario: Validate all the fields exist in pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin checks all the fields are enabled in the Batch Page\r\n    Then The pop up should include the fields Batch Name, Number of classes, and Description as text box, Program Name as drop down in the Batch Page\r\n\r\n  Scenario: Validate batch name prefix selected program name\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin selects program name present in the dropdown of batch page\r\n    Then Admin should see selected program name in the batch name prefix box      \r\n\r\n  Scenario Outline: Validate batch name suffix box should accept only numbers\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets data from \"<sheet>\" for required \"<scenario>\" in batch name suffix box\r\n    Then Admin should get error message below the text box of respective field for batch page\r\n     Examples:\r\n    |sheet  |scenario      |\r\n    |Batch  |invalidSuffix |\r\n\r\n  Scenario Outline: Validate batch name prefix box is not editable\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters alphabets data from \"<sheet>\" for required \"<scenario>\" in batch name prefix box\r\n    Then Admin should see empty text box for batch page\r\n    \r\n    Examples:\r\n    |sheet  |scenario      |\r\n    |Batch  |invalidPrefix |\r\n\r\n    Scenario Outline: Validate input data only for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the data only to the mandatory fields from \"<sheet>\" for required \"<scenario>\" and clicks save button for batch page\r\n    Then Admin should get a successful message for batch page \r\n    Examples:\r\n    |sheet  |scenario       |\r\n    |Batch  |mandatoryFields|\r\n    \r\n  Scenario Outline: Validate input data missing for mandatory fields\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin leaves blank one of the mandatory fields from \"<sheet>\" for required \"<scenario>\" for batch page\r\n    Then Admin should get an error message on the respective mandatory field for batch page\r\n    \r\n     Examples:\r\n    |sheet  |scenario       |\r\n    |Batch  |oneFieldBlank  |\r\n    \r\n\r\n  Scenario Outline: Validate save button in Batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the valid data to all the mandatory fields from \"<sheet>\" for required \"<scenario>\" and clicks save button for batch page\r\n    Then Admin should get a successful message for batch page\r\n    Examples:\r\n    |sheet       |scenario       |\r\n    |Batch  |mandatoryFields|\r\n    \r\n  Scenario Outline: Validate cancel button in Batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin enters the valid data to all the mandatory fields from \"<sheet>\" for required \"<scenario>\" and clicks cancel button for batch page\r\n    Then Admin can see the batch details popup closes without creating any batch \r\n    Examples:\r\n    |sheet  |scenario  |\r\n    |Batch  |mandatoryFields|\r\n\r\n  Scenario: Validate close icon on the batch details pop up\r\n    Given Admin is on the Batch Details Pop Up Window\r\n    When Admin clicks on the close icon for batch page\r\n    Then Batch details pop up closes\r\n\r\n  Scenario: Validate Edit icon feature in any row\r\n    Given Admin is on the batch page\r\n    When Admin clicks the edit icon for batch page\r\n    Then Admin should see the Batch Details pop-up window\r\n\r\n  Scenario: Validate program name value is disabled to edit\r\n    Given Admin is on the batch page\r\n    When Admin clicks the edit icon for batch page\r\n    Then Admin should see Program name value field is disabled for editing for batch page\r\n\r\n  Scenario: Validate batch name value is disabled to edit\r\n    Given Admin is on the batch page\r\n    When Admin clicks the edit icon for batch page\r\n    Then Admin should see batch name value field is disabled for editing\r\n\r\n  Scenario Outline: Validate editing description and No of classes fields with invalid data in the pop up\r\n    Given Admin is on the batch page\r\n    When Admin updates any fields with invalid data from \"<sheet>\" for required \"<scenario>\" and clicks save button for batch page\r\n    Then Admin should get an error message under the respective field for batch page for invalid data\r\n   Examples:\r\n    |sheet  |scenario |\r\n    |Batch  |Invalid  |\r\n    \r\n  Scenario Outline: Validate save button in Batch details pop up\r\n    Given Admin is on the Batch Details Page\r\n    When Admin enters the valid data to all the mandatory fields from \"<sheet>\" for required \"<scenario>\" and clicks save button for batch page\r\n    Then Admin should get a successful message for editing the batch for batch page\r\n     Examples:\r\n    |sheet  |scenario         |\r\n    |Batch  |mandatoryFields  |\r\n    \r\n \r\n\r\n  Scenario: Validate delete icon on any row\r\n    Given Admin is on the batch page\r\n    When Admin clicks the delete icon on any row for batch page\r\n    Then Admin should see the confirm alert box with yes and no button for batch page\r\n\r\n  Scenario: Validate yes button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and clicks the yes button for batch page\r\n    Then Admin should see the successful message and the batch should be deleted for batch page\r\n\r\n  Scenario: Validate no button on the confirm alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the delete icon and clicks the no button for batch page\r\n    Then Admin should see the alert box closed and the batch is not deleted for batch page\r\n\r\n  Scenario: Validate close icon on the alert box\r\n    Given Admin is on the batch confirm popup page\r\n    When Admin clicks on the close icon for batch page\r\n    Then Admin should see the alert box closed for batch page\r\n\r\n  Scenario: Validate single row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header\r\n    Then The respective row in the table should be deleted for batch page\r\n\r\n  Scenario: Validate multiple row delete with checkbox\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the delete icon under the Manage batch header for multiple rows\r\n    Then The respective rows in the table should be deleted for batch page\r\n\r\n  Scenario: Validate next page link\r\n    Given Admin is on the batch page\r\n    When Admin clicks the next page link on the data table for batch page\r\n    Then Admin should see the next enabled link for batch page\r\n\r\n  Scenario: Validate last page link\r\n    Given Admin is on the batch page\r\n    When Admin clicks the last page link on the data table for batch page\r\n   Then Admin should see the last page link with the next page link disabled on the table for batch page\r\n\r\n  Scenario: Validate previous page link\r\n    Given Admin is on the batch page\r\n    When Admin clicks the previous page link on the data table for batch page\r\n    Then Admin should see the previous page on the table for batch page\r\n\r\n  Scenario: Validate first page link\r\n    Given Admin is on the batch page\r\n    When Admin clicks the first page link on the data table for batch page\r\n    Then Admin should see the very first page on the data table for batch page\r\n\r\n  Scenario: Validate search box functionality\r\n    Given Admin is on the batch page\r\n    When Admin enters the batch name in the search text box\r\n    Then Admin should see the filtered batches in the data table\r\n\r\n  Scenario: Validate logout option in the header is visible and enabled from the batch page\r\n    Given Admin is on the batch page\r\n    When Admin clicks on the logout button for batch page\r\n    Then Admin should see the Login screen page from batch page\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/04Batch.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Batch Page Navigation","description":"","childr rs\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/04Batch.feature","name":"Validate search box functionality","language":"en","steps":[{"astNodeIds":["741821f0-95b4-43a2-9485-6cb4368c1beb"],"id":"b3219cd7-3973-4d0f-9508-97a3b25b893f","type":"Context","text":"Admin logs into the application"},{"astNodeIds":["dfffb9a4-f4ff-4449-b4ed-104178515e82"],"id":"105a7d65-483c-4fa8-95e4-283a04d27169","type":"Context","text":"Admin is on the batch page"},{"astNodeIds":["3d41deb2-097d-401d-8fb5-a7ec74c21e3a"],"id":"dced25a6-88ec-4715-be88-3573890bb897","type":"Action","text":"Admin enters the batch name in the search text box"},{"astNodeIds":["ecd2b17e-7d0c-4c50-ac7e-6e4040783058"],"id":"47396bf2-9dd5-43ae-b904-e321943e1406","type":"Outcome","text":"Admin should see the filtered batches in the data table"}],"tags":[],"astNodeIds":["15cc6d2f-5069-43ba-94cb-9834230ba222"]}},{"pickle":{"id":"a68efbc6-f611-40f4-b1a2-a5d00c87cd46","uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/04Batch.feature","name":"Validate logout option in the header is visible and enabled from the batch page","language":"en","steps":[{"astNodeIds":["741821f0-95b4-43a2-9485-6cb4368c1beb"],"id":"8ac70de8-a6ed-4d06-ab20-d8f9a2eb3804","type":"Context","text":"Admin logs into the application"},{"astNodeIds":["e7a63fe3-40e0-4442-bb37-2a29e6daca24"],"id":"2a3c9963-1a79-49fa-803c-311d06babe27","type":"Context","text":"Admin is on the batch page"},{"astNodeIds":["63b4892a-4ef1-4c63-a6c5-9eab533fc382"],"id":"267e1c8d-8d4b-41fc-9a8b-a2efe7a2b3de","type":"Action","text":"Admin clicks on the logout button for batch page"},{"astNodeIds":["fbc99fc8-bfbe-4f64-b520-8ee73dc803e4"],"id":"fe8a1417-1ea4-4820-81ce-26185c56b981","type":"Outcome","text":"Admin should see the Login screen page from batch page"}],"tags":[],"astNodeIds":["8dfb3ab8-affb-485b-9480-a9fc118e755c"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/05Class.feature","data":"@classsenario\nFeature: Class Module\n\n  Background: \n    Given Admin logs into the application\n\n  @TC_Class_01\n  Scenario: Validating the class manage page\n    When Admin clicks the \"Class\" in the Header in class\n    Then Admin should land on the \"Manage Class\" in class\n    And Admin should see the \"LMS - Learning Management System\" Title in class\n    And Admin should see the Searchbar in class\n    And Admin should see the datatable heading like Batchname,class topic,class description,status,class Date,staff name,Edit\/Delete\n\n  @TC_Class_02\n  Scenario: Add New Class Validation\n    When Admin clicks add new class under the class menu bar in class\n    Then Admin should see a manage class pop up with empty form and <SAVE> and <CANCEL> button and Close(X) Icon on the top right corner of the window in class\n    Then Admin should see few input fields and their respective text boxes in the class details window in class\n\n  @TC_Class_03\n  Scenario Outline: Class Details pop up Validation\n    Given Admin is on the Class Popup window in class\n    When Admin enters \"<sheet>\" mandatory fields in the \"<scenario>\" form and clicks on save button in class\n    Then Admin gets message Class added Successfully in class\n\n    Examples: \n      | sheet  | testcase            |\n      | Sheet1 | validInputMandatory |\n\n  @classPagination1\n  Scenario: Verify Next page link(>)\n    # Given Admin is on the Manage Class page\n    When Admin clicks Next page link on the class table\n    Then Admin should see the next page record on the table  with Pagination has next active link enabled\n\n  @classPagination2\n  Scenario: Verify Last page link(>>)\n    #Given Admin is on the Manage Class page\n    When Admins clicks Last page link\n    Then Admin should see the last page record on the table with Next page link are disabled\n\n  @classPagination3\n  Scenario: Verify First page link(<)\n    Given Admin is on last page of class table\n    When Admins clicks First page link\n    Then Admin should see the previous page record on the table with pagination has previous page link enabled\n\n  @classPagination4\n  Scenario: Verify Start page link(<<)\n    Given Admin is on Previous class page\n    When Admin clicks Start page link\n    Then Admin should see the very first page record on the table with Previous page link are disabled\n\n  @classSorting1\n  Scenario: Sort Class by Batch name\n    #Given Admin is on the Manage Class page\n    When Admin clicks on the Batchname sort icon\n    Then Admin should see Class details are sorted by Batch Name\n\n  @classSorting2\n  Scenario: Sort Class by Class topic\n    # Given Admin is on the Manage Class page\n    When Admin clicks on the Class topic sort icon\n    Then Admin should see Class details are sorted by Class topic\n\n  @classSorting3\n  Scenario: Sort Class by Class Descreption\n    # Given Admin is on the Manage Class page\n    When Admin clicks on the descreption sort icon\n    Then Admin should see Class details are sorted by descreption\n\n  @classSorting4\n  Scenario: Sort Class by Class Status\n    #Given Admin is on the Manage Class page\n    When Admin clicks on the Status sort icon\n    Then Admin should see Class details are sorted by Status\n\n  #@classSorting5\n  #Scenario: Sort Class by Class date\n  #Given Admin is on the Manage Class page\n  #When Admin clicks on the Class Date sort icon\n  #Then Admin should see Class details are sorted by Class Date\n  @classSorting6\n  Scenario: Sort Class by staff name\n    #Given Admin is on the Manage Class page\n    When Admin clicks on the Staff Name sort icon\n    Then Admin should see Class details are sorted by Staff Name\n\n  #   @logout\n  #Scenario: Validate logout\n  #When Admin clicks on the logout in the menu bar\n  #Then Admin should be redirected to login page \"Please login to LMS application\"\n  Scenario: Validating Edit Disable option\n    When Admin clicks on the edit icon\n    Then Admin should see batch name field is disabled\n\n  Scenario: Check disabled class topic\n    Then Admin should see class topic field is disabled\n\n  Scenario: Check if the fields are updated with valid data\n    Given Admin is on the Edit Class Popup window\n    When Update the fields with valid data and click save\n    Then Admin gets message \"class details updated Successfully \" and see the updated values in data table\n\n  Scenario: Check if the fields are updated with invalid values\n    When Update the fields with invalid values and click save\n    Then Admin should get Error message\n\n  Scenario: Check if the mandatory fields are updated with valid data\n    When Update the mandatory fields with valid values and click save\n\n  Scenario: Check if the optional fields are updated with valid data\n    When Update the optional fields with valid values and click save\n\n  Scenario: Validate Cancel button on Edit popup\n    When Admin clicks Cancel button on edit popup\n    Then Admin can see the class details popup disappears and can see nothing changed for particular Class\n\n  Scenario: Class link on navigation bar\n    Given Admin is in Manage Class page\n    When Admin clicks on Class link on Manage Class page\n    Then Admin is redirected to class page\n\n  Scenario: Logout link on navigation bar\n    When Admin clicks on Logout link on Manage class page\n    Then Admin is redirected to Login page\n\n  Scenario: Search class by Batch Name\n    Given Admin is the Manage class page\n    When Admin enter the Batch Name in search textbox\n    Then Admin should see Class details are searched by Batch Name\n\n  Scenario: Search class by Class topic\n    When Admin enter the Class topic in search textbox\n    Then Admin should see Class details are searched by Class topic\n\n  Scenario: Validate row level delete icon\n    Given Admin should on Manage Class Page\n    When Admin clicks the delete icon\n    Then Admin should see a alert open with heading \"Confirm\" along with  <YES> and <NO> button for deletion\n\n  Scenario: Validate Common Delete button enabled after clicking on any checkbox\n    Given Admin  in Manage Class page\n    When Admin clicks any checkbox in the data table\n    Then Admin should see common delete option enabled under header Manage class\n\n  Scenario: Admin is on Confirm Deletion alert\n    Given Admin is on Confirm Deletion alert\n    When Admin clicks yes option\n    Then Admin gets a message \"Successful Class Deleted\" alert and do not see that Class in the data table\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/msira\/automation\/Team9_AutomationSquad_LMS_UI_Hackathon_Phase2\/src\/test\/resources\/features\/05Class.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@classsenario","id":"1726c982-2562-4128-8ae9-6670bf084dbc"}],"language":"en","keyword":"Feature","name":"Class Module","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Admin logs into the application","id":"10b55c74-eca2-4ed8-9709-0474b640c71c"}],"id":"375b0010-3f4c-48c8-b9c7-c759d69927f2"}},{"scenario":{"location":{"line":8,"column":3},"tags":[{"location":{"line":7,"column":3},"name":"@TC_Class_01","id":"9509f1be-88f6-413a-a50d-a13d6b907c79"}],"keyword":"Scenario","name":"Validating the class manage page","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"Admin clicks the \"Class\" in the Header in class","id":"a2dbbc1e-bdd7-4e16-9a8f-7a5e6d0cda75"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Admin should land on the \"Manage Class\" in class","id"
